      names: [], 
    };
  }



componentDidMount() {
  fetch('http://127.0.0.1:5000/users')
  .then(results => {
    return results.json();
  }).then(data => {
    let names = data.results.map((name) => {
      console.log(name)
      return(
        <h1>names.results</h1>
      )
    })

    this.setState({names: names})
    console.log("state", this.state.names)
  })
}
render() {
  return(
    this.state.names
  )
}
}
export default AltUsers
